sap.ui.define(["application/controller/BaseController"],function(e){"use strict";return e.extend("application.controller.MenuComercial",{onInit:function(){this.getRouter().getRoute("menuComercial").attachPatternMatched(this._onRouteMatched,this)},_onRouteMatched:function(){},onAfterRendering:function(){this.byId("page").setShowHeader(true)},onTile:function(e){switch(e.getSource().data("opcao")){case"menuConsultas":sap.ui.core.UIComponent.getRouterFor(this).navTo("menuConsultas");break;case"relatorios":sap.ui.core.UIComponent.getRouterFor(this).navTo("menuRelatorios");break}},onNavBack:function(){sap.ui.core.UIComponent.getRouterFor(this).navTo("menu")}})});